import React, {Component} from 'react';

let habits = [
    {
        id:1,
        habit:"Work Out",
        duration:30,
        commitment:5
    }
]

export class MyHabits extends Component {
    constructor(){
        super()
        this.state = {
            habits:habits
        }
    }
    render(){
        return(
            <div>
                <ul>
                    {this.state.habits.map(row => {
                        return (
                            <li>
                                <h1> -- </h1>
                            </li>
                        )
                    })}
                </ul>
            </div>
        )
    }
}
